import logo from './logo.svg';
import './App.css';

const name = "Test 1";
const element1 = <h1>Witaj Å›wiecie!</h1>
const element2 = <p>To jest: {name}</p>
const elemSum = <div>element1 + element2</div>;
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        {elemSum}
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React1
        </a>
      </header>
    </div>
  );
}

export default App;
